import React, { useState } from "react";
import jsPDF from "jspdf";

function PdfGenerator() {
  var base64 = ""
  // console.log(base64);
  const [pdfUrl, setPdfUrl] = useState(null);
  const generatePDF = () => {
    convertBase64ToPDF(base64)
    return
    const doc = new jsPDF({
      orientation: "portrait",
      unit: "mm",
      format: "a4",
    });

    doc.addFont("../src/assets/fonts/Sarabun-Thin.ttf", "Sarabun", "normal");

    doc.setFont("Sarabun"); // set font
    doc.setFontSize(11);

    var arabicText =
      "    สวัสดีสวัสดีสวัสดีสวัสดีสวัสดีสวัสดีสวัสดีสวัสดีสวัสดีสวัสดีสวัสดีสวัสดีสวัสดีสวัสดีสวัสดีสวัสดีสวัสดีสวัสดีสวัสดีสวัสดีสวัสดีสวัสดีสวัสดีสวัสดี";
    var splitTitle = doc.splitTextToSize(arabicText, 180);
    doc.text(15, 20, splitTitle);

    const pdfBlob = doc.output("blob");
    const pdfUrl = URL.createObjectURL(pdfBlob);

    // Log the base64 data to the console
    const reader = new FileReader();
    reader.onloadend = () => {
      const base64data = reader.result.split(",")[1];
      console.log(base64data);
    };
    reader.readAsDataURL(pdfBlob);

    window.open(pdfUrl, "_blank");
  };

  const convertBase64ToPDF = (base64Data) => {
    try {
      // Decode base64 to binary
      const binaryData = atob(base64Data);

      // Create a Blob from binary data
      const byteArray = new Uint8Array(binaryData.length);

      for (let i = 0; i < binaryData.length; i++) {
        byteArray[i] = binaryData.charCodeAt(i);
      }
      const blob = new Blob([byteArray], { type: "application/pdf" });

      // Generate a URL for the Blob
      const pdfUrl = URL.createObjectURL(blob);
      window.open(pdfUrl, "_blank");
    } catch (error) {
      console.error("Error converting base64 to PDF:", error);
    }
  };

  return (
    <div>
      <button onClick={generatePDF}>Generate PDF</button>
    </div>
  );
}

export default PdfGenerator;
